function Dashboard() {
  return (
      <div className="container mt-4">
        <div className="row">
            <aside className="col-md-3">
              <div className="list-group">
                <a href="#" className="list-group-item list-group-item-action">List 1</a>
              </div>
            </aside>
            <section className="col-md-9"></section>
        </div>
      </div>
    )
}

export default Dashboard;
